import React, { useRef, useState, useEffect } from "react";
import { Redirect } from 'react-router';
import { Header } from "../../common/Header";
import {
    MDBBtn,
    MDBFreeBird,
    MDBCard,
    MDBCardBody,
    MDBCardImage,
    MDBCardText,
    MDBCol,
    MDBContainer,
    MDBFormInline,
    MDBIcon,
    MDBInput,
    MDBRow,
    MDBTable,
    MDBTableBody,
    MDBTableHead,
    MDBEdgeHeader,
    MDBCardTitle,
    MDBProgress
} from "mdbreact";
import { useHistory } from "react-router";
import { Chart } from "react-google-charts";
import "./style.css"

export const Home = (props: any) => {
    console.log(props)
    if (props.User === undefined) {
        return <Redirect to={{
            pathname: '/login',
        }} />
    }

    return (
        <>
            <MDBContainer className="pt-5 pb-5">
                <MDBRow style={{ padding: "10px", border: "1px solid #ededef" }}>
                    <MDBCol md="12" lg="12">
                    <p className='text-light font-weight-bold' style={{ fontSize: "22px", paddingTop: "10px" }}>Organisation health</p>
                    <div>
                        <MDBBtn style={{ border: "2px solid #2bbbad", borderRadius: "10px", marginLeft: "20px" }}>Scan
                       <MDBIcon icon="sync-alt" style={{ fontSize: "10px", marginLeft: "5px" }} /></MDBBtn>
                    </div>
                    <span className='text-dark' style={{ fontSize: "12px", marginLeft: "10px", paddingTop: "20px" }}>Last synced 6th June 18:05</span>
                    </MDBCol>
                    <br />
                    <MDBCol>
                    <div>
                        <Chart
                            width={500}
                            height={180}
                            chartType="Gauge"
                            loader={<div>Loading Chart</div>}
                            data={[
                                ['Label', 'Value'],
                                [' ', 80],
                            ]}
                            options={{
                                greenColor: "#008450",
                                redFrom: 0,
                                redTo: 33,
                                yellowFrom: 33,
                                yellowTo: 66,
                                greenFrom: 66,
                                greenTo: 100,
                                animation:{
                                    duration: 10000,
                                    easing: 'out',
                                  },
                                minorTicks: 4,
                                majorTicks: [32, 65]
                            }}
                           // rootProps={{ 'data-testid': '1' }}
                        />
                    </div>
                    </MDBCol>
                </MDBRow>



            </MDBContainer>
        </>
    )
}
